import React, { useEffect, useState } from "react";

function QuizApp() {
  // Gán trực tiếp dữ liệu sinh viên
  const studentData = {
    studentName: "Nguyễn Văn A",
    studentId: "B21DCCN001",
    roomName: "Phòng 101",
    examCode: "DE001",
  };

  // Gán trực tiếp dữ liệu đề thi
  const examConfig = {
    examCodes: [
      {
        code: "DE001",
        questionsData: [
          {
            questionText: "1 + 1 bằng mấy?",
            options: ["1", "2", "3", "4"],
            correctAnswer: 1,
          },
          {
            questionText: "Thủ đô của Việt Nam là gì?",
            options: ["Hà Nội", "TP. Hồ Chí Minh", "Đà Nẵng", "Huế"],
            correctAnswer: 0,
          },
          {
            questionText: "Màu nào thường thấy của bầu trời ban ngày?",
            options: ["Đỏ", "Vàng", "Xanh dương", "Tím"],
            correctAnswer: 2,
          },
          {
            questionText: "HTML là viết tắt của?",
            options: [
              "Hyper Text Markup Language",
              "High Text Machine Language",
              "Hyperlink and Text Markup Language",
              "Home Tool Markup Language",
            ],
            correctAnswer: 0,
          },
          {
            questionText: "Phím tắt sao chép trên Windows là?",
            options: ["Ctrl + V", "Ctrl + C", "Ctrl + X", "Ctrl + Z"],
            correctAnswer: 1,
          },
        ],
      },
    ],
  };

  const [timeLeft, setTimeLeft] = useState(30 * 60); // 30 phút
  const [isExamOver, setIsExamOver] = useState(false);
  const [studentAnswers, setStudentAnswers] = useState([]);

  useEffect(() => {
    const timer = setInterval(() => {
      setTimeLeft((prevTime) => {
        if (prevTime <= 0) {
          clearInterval(timer);
          setIsExamOver(true);
          return 0;
        }
        return prevTime - 1;
      });
    }, 1000);

    return () => clearInterval(timer);
  }, []);

  const handleAnswerChange = (questionIndex, answerIndex) => {
    const newAnswers = [...studentAnswers];
    newAnswers[questionIndex] = answerIndex;
    setStudentAnswers(newAnswers);
  };

  const handleSubmit = () => {
    setIsExamOver(true);
    alert("Bài thi đã được nộp!");
    // Optional: chấm điểm
    let correctCount = 0;
    exam.questionsData.forEach((q, index) => {
      if (studentAnswers[index] === q.correctAnswer) {
        correctCount++;
      }
    });
    alert(`Bạn trả lời đúng ${correctCount}/${exam.questionsData.length} câu.`);
  };

  const exam = examConfig.examCodes.find(
    (e) => e.code === studentData.examCode
  );

  if (!exam || !exam.questionsData)
    return <p>Không tìm thấy đề thi phù hợp!</p>;

  const formatTime = (time) => {
    const minutes = Math.floor(time / 60);
    const seconds = time % 60;
    return `${minutes}:${seconds < 10 ? `0${seconds}` : seconds}`;
  };

  return (
    <div className="quiz-container">
      <h2>
        Đề {studentData.examCode} - Phòng {studentData.roomName}
      </h2>
      <p>
        Họ tên: {studentData.studentName} - MSSV: {studentData.studentId}
      </p>
      <p>Số câu hỏi: {exam.questionsData.length}</p>

      <div className="timer">
        <h4>Thời gian còn lại: {formatTime(timeLeft)}</h4>
        {isExamOver && <p>Thời gian đã hết!</p>}
      </div>

      {exam.questionsData.map((q, index) => (
        <div key={index} className="question-box">
          <h4>
            Câu {index + 1}: {q.questionText}
          </h4>
          {q.options.map((opt, i) => (
            <div key={i}>
              <label>
                <input
                  type="radio"
                  name={`q${index}`}
                  value={i}
                  checked={studentAnswers[index] === i}
                  onChange={() => handleAnswerChange(index, i)}
                  disabled={isExamOver}
                />
                {String.fromCharCode(65 + i)}. {opt}
              </label>
            </div>
          ))}
        </div>
      ))}

      {!isExamOver && (
        <button className="submit-button" onClick={handleSubmit}>
          Nộp bài
        </button>
      )}
    </div>
  );
}

export default QuizApp;
